//Pages
import  {HomePage}  from './pages/HomePage';
import {ProductPage} from './pages/ProductPage';



//py in jsx=padding y axis

const App = ()=>  {
  return (
    <Router> 
     <Header/>
      <main className="py-3">
        <Container>
          <Route path='/' component={HomePage} exact/>
        </Container>

      </main>
      <Footer/>
    </Router>
  );
}

export default App;
